void main(List<String> arguments) {
  bool hasAdjacentDuplicates(List<dynamic> list) {
    for (int i = 0; i < list.length - 1; i++) {
      if (list[i] == list[i + 1]) {
        return true;
      }
    }
    return false;
  }

  String removeDuplicates(String s) {
    List myList = s.toLowerCase().split("");

    while (hasAdjacentDuplicates(myList)) {
      var j = 1;
      for (var i = 0; i < myList.length; i++, j++) {
        if (j < myList.length && myList[i] == myList[j]) {
          myList.removeAt(i);
          myList.removeAt(i);
        }
      }
    }
    return myList.join();
  }

  String a =
      "";
  print(removeDuplicates(a));
}
